import './App.css';
import * as React from "react";
import {Route, Link, Routes, useNavigate} from 'react-router-dom';
import Page1 from './adpage1';
function App() {
  const navigate = useNavigate();
  return (
    <div>
    <Link to='/adpage1' >Go link</Link>
    <br />
    <button onClick={()=>navigate('/adpage1')}>Go to product</button>	
    <br />

		</div>
  );
}
export default App
